var coverImage =
  "data:image/png;base64,";

$(document).ready(function () {
  var snowflake = $(".snowflake ");
  var scratchImage = $(".scratch-image ");
  var bridgeDiv = $("#bridge ");

  //--------------------------------------GENERAL VARIABLES---------------------------------------
  /**param claimPagePath = the path to the claim page
   * param guid = the player's current guid
   * param mkw = the variable which represents the player's prize*/
  var claimPagePath = "/promociones/promociones-mixtas/invierno-2017/claim.htm",
    guid = "978976456",
    firstName = "john",
    rlMkw = 0,
    mkw = rlMkw,
    /*campaignId = rlCampaignId,*/
    prizes = [
      {
        pic: "Winter_2018_ES_Mini_Game_boots.png",
        prize: "0"
      },
      {
        pic: "Winter_2018_ES_Mini_Game_Fur.png",
        prize: "0"
      },
      {
        pic: "Winter_2018_ES_Mini_Game_Knife.png",
        prize: "0"
      },
      {
        pic: "Winter_2018_ES_Mini_Game_Harpoons.png",
        prize: "0"
      },
      {
        pic: "Winter_2018_ES_Mini_Game_Hook.png",
        prize: "0"
      },
      {
        pic: "Winter_2018_ES_Mini_Game_Diamond.png",
        prize: "0"
      }
    ];

  window.onload = function () {
    bridgeDiv.css("background", "url(' images/" + prizes[mkw].pic + " ') center center no-repeat");
  };

  //-------------------------------------SCRATCH CARD RELATED VARIABLES----------------------------
  /**the object which contains every variable and function related to the scratching percentages
   * param current = the current scratching percentage
   * param completePercentage = the percentage on which the scratch counts as complete
   * param getPercentage = a function which returns the current clear percentage of the sratch card
   * param clearCanvasOnComplete = a function which clears the canvas if the current percentage passes the complete percentage,
   *        and pops up the prize window */
  var percentage = {
    current: 0,
    completePercentage: 75,
    getPercentage: function () {
      //get the canvas image data
      var imageData = bridgeCanvas.getImageData(0, 0, bridge.width, bridge.height);
      var changedPixels = 0;

      //check how many pixles have been cleared
      for (var i = 0; i < imageData.data.length; i += 4) {
        if (imageData.data[i] == 0) {
          changedPixels++;
        }
      }

      //calculate the current clear percentage and return it
      percentage.current = Math.ceil((changedPixels / imageData.data.length) * 100 * 4);
      return percentage.current;
    },
    clearCanvasOnComplete: function () {
      if (percentage.getPercentage() > percentage.completePercentage) {
        //clear the canvas if the current percentage passes the complete percentage
        bridgeCanvas.clearRect(0, 0, bridge.width, bridge.height);
        //send to claim page
        sendToClaimPage();
      }
    }
  };

  /**param bridge = the canvas object
   * param bridgeCanvas = the canvas context object
   * param brushRadius = the radius the brush clears on with a single click
   * param img = the img the canvas will contain  */
  var bridge = document.getElementById("bridge"),
    bridgeCanvas = bridge.getContext("2d"),
    brushRadius = (bridge.width / 100) * 5,
    img = new Image();

  if (brushRadius < 50) {
    brushRadius = 50;
  }

  setTimeout(function () {
    //draw the img on the canvas when it loads
    img.onload = function () {
      bridgeCanvas.drawImage(img, 0, 0, bridge.width, bridge.height);
      displayCanvas();
    };

    img.crossOrigin = "Anonymous";
    //sets the imgs file name
    img.filename = coverImage;

    //sets the img's src
    img.src = img.filename;
  }, 1000);

  function detectLeftButton(event) {
    if ("buttons" in event) {
      return event.buttons === 1;
    } else if ("which" in event) {
      return event.which === 1;
    } else {
      return event.button === 1;
    }
  }

  function getBrushPos(xRef, yRef) {
    var bridgeRect = bridge.getBoundingClientRect();
    return {
      x: Math.floor(((xRef - bridgeRect.left) / (bridgeRect.right - bridgeRect.left)) * bridge.width),
      y: Math.floor(((yRef - bridgeRect.top) / (bridgeRect.bottom - bridgeRect.top)) * bridge.height)
    };
  }

  function drawDot(mouseX, mouseY) {
    bridgeCanvas.beginPath();
    bridgeCanvas.arc(mouseX, mouseY, brushRadius, 0, 2 * Math.PI, true);
    bridgeCanvas.fillStyle = "#000";
    bridgeCanvas.globalCompositeOperation = "destination-out";
    bridgeCanvas.fill();

    //check clear percentage
    percentage.clearCanvasOnComplete();
  }

  function sendToClaimPage() {
    setTimeout(function () {
      $(".prize, .content").fadeOut();
      setTimeout(function () {
        $(".scratch").fadeOut();
        $("h2").fadeOut();
        $(".claim-wrap ").fadeIn();
        window.location.href =
          claimPagePath + "?guid=" + guid + "&mkw=" + mkw + "&firstname=" + firstName + "&campaignId=" + campaignId;
      }, 1000);
    }, 500);
  }

  /**Attach the drawing function to the movement events*/
  bridge.addEventListener(
    "mousemove",
    function (e) {
      var brushPos = getBrushPos(e.clientX, e.clientY);
      var leftBut = detectLeftButton(e);
      if (leftBut == 1) {
        if (scratchImage.is(":visible")) scratchImage.fadeOut(200);
        drawDot(brushPos.x, brushPos.y);
      }
    },
    false
  );

  bridge.addEventListener(
    "touchmove",
    function (e) {
      e.preventDefault();
      var touch = e.targetTouches[0];
      if (touch) {
        var brushPos = getBrushPos(touch.pageX, touch.pageY);
        if (scratchImage.is(":visible")) scratchImage.fadeOut(200);
        drawDot(brushPos.x, brushPos.y);
      }
    },
    false
  );

  function displayCanvas() {
    bridgeDiv.fadeIn();
    scratchImage.fadeIn();
    snowflake.fadeOut();
  }

  var $bridge = $(".scratch");
  var cursor = $("#cursor");
  var cursorDeltaX;
  var cursorDeltaY;

  cursorDelta();
  $(window).on("resize", function (e) {
    cursorDelta();
  });

  function cursorDelta() {
    if ($(window).width() > 500) {
      cursorDeltaX = 85;
      cursorDeltaY = 65;
    } else {
      cursorDeltaX = 30;
      cursorDeltaY = 80;
    }
  }

  $(document).on("mousemove", function (e) {
    if ($bridge.is(":hover")) {
      cursor.css({
        left: e.pageX - cursorDeltaX,
        top: e.pageY - cursorDeltaY,
        transform: "scale(1)",
        opacity: 1
      });
    } else {
      cursor.css({
        transform: "scale(0)",
        opacity: 0
      });
    }
  });

  //canvas init
  var canvas = document.getElementById("snow");
  var ctx = canvas.getContext("2d");
  var TheSize = 4;
  //canvas dimensions
  var W = window.innerWidth;
  var H = window.innerHeight;
  canvas.width = W;
  canvas.height = H;
  setSize();

  //snowflake particles
  var mp = 25; //max particles
  var particles = [];
  for (var i = 0; i < mp; i++) {
    particles.push({
      x: Math.random() * W, //x-coordinate
      y: Math.random() * H, //y-coordinate
      r: Math.random() * TheSize + 1, //radius
      d: Math.random() * mp //density
    });
  }

  window.addEventListener("resize", function (event) {
    W = window.innerWidth;
    H = window.innerHeight;
    canvas.width = W;
    canvas.height = H;
    setSize();
  });

  function setSize() {
    if (W < 500) TheSize = 2;
    else TheSize = 4;
  }

  //Lets draw the flakes
  function draw() {
    ctx.clearRect(0, 0, W, H);

    ctx.fillStyle = "rgba(255, 255, 255, 0.8)";
    ctx.beginPath();
    for (var i = 0; i < mp; i++) {
      var p = particles[i];
      ctx.moveTo(p.x, p.y);
      ctx.arc(p.x, p.y, p.r, 0, Math.PI * 2, true);
    }
    ctx.fill();
    update();
  }

  //Function to move the snowflakes
  //angle will be an ongoing incremental flag. Sin and Cos functions will be applied to it to create vertical and horizontal movements of the flakes
  var angle = 0;
  function update() {
    angle += 0.01;
    for (var i = 0; i < mp; i++) {
      var p = particles[i];
      //Updating X and Y coordinates
      //We will add 1 to the cos function to prevent negative values which will lead flakes to move upwards
      //Every particle has its own density which can be used to make the downward movement different for each flake
      //Lets make it more random by adding in the radius
      p.y += Math.cos(angle + p.d) + 1 + p.r / 2;
      p.x += Math.sin(angle) * 2;

      //Sending flakes back from the top when it exits
      //Lets make it a bit more organic and let flakes enter from the left and right also.
      if (p.x > W + 5 || p.x < -5 || p.y > H) {
        if (i % 3 > 0) {
          //66.67% of the flakes
          particles[i] = { x: Math.random() * W, y: -10, r: p.r, d: p.d };
        } else {
          //If the flake is exitting from the right
          if (Math.sin(angle) > 0) {
            //Enter from the left
            particles[i] = { x: -5, y: Math.random() * H, r: p.r, d: p.d };
          } else {
            //Enter from the right
            particles[i] = { x: W + 5, y: Math.random() * H, r: p.r, d: p.d };
          }
        }
      }
    }
  }

  //animation loop
  setInterval(draw, 33);
});
